import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div className='app'>

      <main>



        <Switch>
          <Route exact path="/" components={HomeScreen}/>
          <Route exact path="/product/:id" components={ProductScreen}/>
          <Route exact path="/cart" components={CartScreen}/>
        </Switch>

      </main>



    </div>

  );
}

export default App;
